import './ExpensePrice.css';

function expensePrice (props) {
return (
<div>
<div className="expense-item__price">
          ${props.amount}
    </div>
    <div className='expenses'>
        BTC: {props.amount/21000}
    </div>
</div>
    );
}
export default expensePrice;
